import React, {useState, useEffect} from 'react';
import {ActivityIndicator, Dimensions, StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import { restaurants } from '../App';

export default  function Home({navigation}) {
    return (
        <View style={{flex: 1}}>
          <ScrollView style={styles.container}>{
            Object.keys(restaurants).map(restaurante => {
                return(
                    <TouchableWithoutFeedback  key={restaurante.id}  onPress={() => navigation.push('restaurants', {user : restaurante})}>
                      <View style={{flexDirection: 'row', backgroundColor: 'ghostwhite'}}>
                      <Image source={{uri: restaurante.uri}} style={styles.image}/> 
                      <View style={{flex : 1, flexDirection : 'column', justifyContent : 'flex-start', alignItems:'center'}}>
                        <Text style={styles.username}>{restaurante}</Text>
                        <Text style={styles.bio}>{restaurants[restaurante].PricePoint} * {restaurants[restaurante].Tags.map(tag => "tag * ")}</Text>
                      </View>
                      </View>
                    </TouchableWithoutFeedback>
                )
              })
          }</ScrollView>
        </View>
    );
}


const styles = StyleSheet.create({
    container: {
      backgroundColor: 'white',
    },
    username: {
      fontSize: 20,
      textAlign: 'center',
    },
    bio : {
      justifyContent:'flex-start',
    },
    image: {
        width: 100,
        height: 100,
      }
  });
